import Constants from '../shared/constants';
import { Circle } from './shape';
import Player from './player';
var Game = /** @class */ (function () {
    function Game(io) {
        this.players = [];
        setInterval(this.update.bind(this), 1000 / 60);
        this.lastUpdate = Date.now();
        this.io = io;
    }
    Game.prototype.join = function (socket) {
        this.players.push(new Player(socket, new Circle(100, 100, 5, "red")));
        this.fullUpdate(true);
    };
    Game.prototype.leave = function (socket) {
        this.players = this.players.filter(function (p) { return (p.socket.id != socket.id); });
        this.fullUpdate(true);
    };
    Game.prototype.input = function (socket, input) {
        this.players.find(function (p) { return p.socket.id == socket.id; }).addInput(input);
    };
    Game.prototype.update = function () {
        var now = Date.now();
        var deltaTime = (now - this.lastUpdate) / 1000;
        this.lastUpdate = now;
        if (Math.random() < .1) {
            this.fullUpdate(false);
        }
    };
    Game.prototype.fullUpdate = function (initial) {
        this.players.forEach(function (player) {
            player.update(true);
        });
        var state = this.players.map(function (player) { return player.serialize(initial); });
        this.io.sockets.emit(Constants.SOCKET.STATE, state);
    };
    return Game;
}());
export default Game;

