var express = require('express');
var http = require('http');
var path = require('path');
var socketIO = require('socket.io');
var app = express();
var server = http.Server(app);
var io = socketIO(server);
import Constants from '../shared/constants';
import GameClass from './game';
var Game = new GameClass(io);
app.set('port', 5000);
app.use('/', express.static(path.join(__dirname, '/../../dist')));
app.use('/shared', express.static(path.join(__dirname, '/../shared')));
app.get("/", function (req, res) {
    res.sendFile(path.join(__dirname, '../client/html/index.html'));
});
server.listen(5000, function () {
    console.log("Server is running in http://localhost:5000");
});
io.on('connection', function (socket) {
    socket.on(Constants.SOCKET.JOIN, function () { Game.join(socket); });
    socket.on(Constants.SOCKET.INPUTS, function (input) {
        Game.input(socket, input);
    });
    socket.on('disconnect', function () { Game.leave(socket); });
});

